import React from "react";
import "./userForm.css";
import axios from "axios";
import { useEffect } from "react";




const [data, setData] = useState([
  {
    _id: 0,
    name: "dat",
    birthDay: "",
  },
]);
const getDataUser = () => {
  axios({
    method: "get",
